let input = `



`
input = input.split('\n');
input = input.map(line => {return line.split('')})

// Problem 2a keypad
// const keypad = [[1, 2, 3],
// 				[4, 5, 6],
// 				[7, 8, 9]];
// let outer = 1; // outer array index
// let inner = 1; // inner array index

// Problem 2b keypad
const keypad = [[null, null, 1, null, null],
				[null, 2, 3, 4, null],
				[5, 6, 7, 8, 9],
				[null, 'A', 'B', 'C', null],
				[null, null, 'D', null, null]]

let outer = 2;
let inner = 0;

let bathroomCode = '';
// if L move inner -1
// if R move inner +1
// if U move outer -1
// if D move outer +1

function getNumber(input) {

	for (let i = 0; i < input.length; i++){

		switch(input[i]){

			case 'L':
				if (keypad[outer][inner - 1]) inner --;
				break;

			case 'R':
				if (keypad[outer][inner + 1]) inner ++;
				break;

			case 'U':
				if (keypad[outer - 1] && keypad[outer - 1][inner]) outer --;
				break;

			case 'D':
				if (keypad[outer + 1] && keypad[outer + 1][inner]) outer ++;
				break;

			default:
				console.log('Its broken');

		}
	}

	return keypad[outer][inner];
}

input.forEach(function(line){
	bathroomCode += getNumber(line);
})

return bathroomCode;

